import React from "react";
import data from "./babyNamesData.json";
import "./App.css";

function App() {
  return (
    <div className="App">
      <p>
        {data
          .sort((a, b) => a.name.localeCompare(b.name))
          .map((el, id) => {
            if (el.sex === "f") {
              return (
                <span key={id} className="orange">
                  {" "}
                  {el.name}{" "}
                </span>
              );
            } else {
              return (
                <span key={id} className="blue">
                  {" "}
                  {el.name}{" "}
                </span>
              );
            }
          })}
      </p>
    </div>
  );
}

export default App;
